import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */



const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1>{`Pontte <-> Pypefy => pipepontte,`}</h1>
    <blockquote>
      <p parentName="blockquote">{`url: Pontte.com/Pipefy`}</p>
    </blockquote>
    <h1>{`Cards (Contracts)`}</h1>
    <blockquote>
      <p parentName="blockquote">{`path .../cards`}</p>
    </blockquote>
    <h6><em parentName="h6">{`a Pipefy card is the equivalent of a Contract in our database`}</em></h6>
    <p>{`api/ list all cards api/CRUD/{`}<em parentName="p">{`ID`}</em>{`} create read update delete`}</p>
    </MDXLayout>;
}

;
